import React from 'react';
import './Home.css';
import 'materialize-css/dist/css/materialize.min.css';

const Home = () => {
  return (
    <div className='container'>
      <h1 className='red-text text-lighten-3'> Welcome to the landing Page</h1>

      <p className='red-text text-lighten-3'>
        Enjoy this Video on Programming, Mybe you too will learn to Code and be
        the Wizzard of Tomorow.
      </p>

      <div class='video-container'>
        <iframe
          width='853'
          height='480'
          src='https://youtube.com/embed/Dv7gLpW91DM'
          frameborder='0'
          allowfullscreen
        ></iframe>
      </div>
    </div>
  );
};

export default Home;
